export const fetchSegmentationResults = async () => {
    const response = await fetch('/path/to/segmentation_results.json');
    const data = await response.json();
    return data;
  };
  
  export const fetchPerformanceResults = async () => {
    const response = await fetch('/path/to/performance_predictions.json');
    const data = await response.json();
    return data;
  };
  
  export const fetchChurnResults = async () => {
    const response = await fetch('/path/to/churn_predictions.json');
    const data = await response.json();
    return data;
  };
